var margin = {top: 20, right: 80, bottom: 60, left: 60}
  , width = 1000 - margin.left - margin.right
  , height = 500 - margin.top - margin.bottom;

maxX = Number.NEGATIVE_INFINITY
maxY = Number.NEGATIVE_INFINITY
minY = Infinity

dataList = [emmaData, rubioData, cameronData, tapperData, danaData]
for(ix in dataList){
  maxX = Math.max(maxX, d3.max(dataList[ix], function(d) { return d.timestamp + 1; }))
  //minX = Math.min(inX, d3.min(dataList[ix], function(d) { return d.timestamp; }))

  minY = -1.5 //Math.min(minY, d3.min(dataList[ix], function(d) { return d.sent - 2;}))
  maxY = Math.max(maxY, d3.max(dataList[ix], function(d) { return d.sent + 1; }))
}
console.log(maxX, minY, maxY)

var x = d3.scaleLinear()
          .domain([0, maxX])
          .range([ 0, width ]);

var yRange = [minY, maxY]
var y = d3.scaleLinear()
	      .domain(yRange)
	      .range([ height, 0 ]);

colorNegative = yRange[1]+(yRange[1]-yRange[0])*.25
colorPositive = yRange[0]
var color = d3.scaleSequential(d3["interpolate" + "Viridis"])
    .domain([colorNegative, colorPositive]);

var chart = d3.select('.content')
	.append('svg')
	.attr('width', width + margin.right + margin.left)
	.attr('height', height + margin.top + margin.bottom)
	.attr('class', 'chart')

var main = chart.append('g')
	.attr('transform', 'translate(' + margin.left + ',' + margin.top + ')')
	.attr('width', width)
	.attr('height', height)
	.attr('class', 'main')   
        
  // draw the x axis
  var xAxis = d3.axisBottom(x)
                .tickFormat(function(d) { 
                                hrs = 9 + Math.floor(d/60)
                                mins = d - 60
                                return String(hrs) + ":" + String(mins); 
                              });

  main.append("text")             
      .attr("transform",
            "translate(" + (width/2) + " ," + 
                           (height + margin.top + 20) + ")")
      .style("font-size","16px")
      .style("text-anchor", "middle")
      .text("Time");

    main.append('g')
	.attr('transform', 'translate(0,' + height + ')')
	.attr('class', 'x-axis')
	.call(xAxis);

    // draw the y axis
    var yAxis = d3.axisLeft(y);

    main.append("text")
      .attr("transform", "rotate(-90)")
      .attr("y", 0 - margin.left)
      .attr("x",0 - (height / 2))
      .attr("dy", "1em")
      .style("text-anchor", "middle")
      .style("font-size","16px")
      .text("Number of Tweets"); 

    main.append('g')
	.attr('transform', 'translate(0,0)')
	.attr('class', 'y-axis')
	.call(yAxis);

  var g = main.append("g");

var regLine = d3.line()
        .x(function(d) {
            return x(d.timestamp);
        })
        .y(function(d) {
            return y(d.timestamp*d.slope + d.intercept);
        });
var trendline = main.select(".trendline")


var bars = main.selectAll(".bars")
    .data(d3.range(maxY), function(d) { return d; })
  .enter().append("rect")
    .attr("class", "bars")
    .attr("x", width + 20)
    .attr("y", function(d, i) { return y(i) - height + margin.top*2; })
    .attr("height", height - margin.top*2)
